  false,\n\t\"url\": null,\n\t\"notes\": \"Gridded multibeam bathymetry is integrated
  with bathymetry derived from multpectral IKONOS satellite data. Gridded (5 m cell
  size) multibeam bathymetry collected aboard NOAA Ship Hiialaka'i and R/V AHI. Bathymetry
  values shallower than 15 m were derived by gauging the relative attenuation of blue
  and green spectral radiance as a function of depth. A multiple linear regression
  analysis of linearized blue and green band spectral values against depth determined
  the variables of y-intercept, blue slope and green slope values. Variables then
  used in multivariate slope intercept formula to derive depth. Variables were adjusted
  to improve the statistical accuracy and spatial coverage of the final derived bathymetry
  product. Digital image processing to derive depths conducted with the ENVI 4.5 software
  program while data editing and integration was performed using ArcGIS 9.3. This
  dataset is for the shelf environment of Asuncion Island, Commonwealth of the Northern
  Marianas Islands, USA\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
